import React from 'react'
import {Container, Nav, Navbar} from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
const NavBar = () => {
  return (
    <Navbar  sticky='top' >
      <Container >
        <Navbar.Brand href='#' style={{textDecoration:'none'}}>Get the App </Navbar.Brand>
      <Nav>
        <Nav.Link><Link>Investor Relations</Link>Investor Relations</Nav.Link>
        <Nav.Link href='#'>Add restaurant</Nav.Link>
        <Nav.Link><Link to='/logi'></Link>Log in</Nav.Link>
        <Nav.Link href='#'>Sign up</Nav.Link>
      </Nav>
      </Container>
    </Navbar>

  )
}

export default NavBar
